import React from 'react';

const Peopleinfo = ({ name, birth_year, height, mass }) => {
    return (
        <div className='container'>
            <div className="center">
                <img src="../public/swicon.png" alt=""/>
                <h3>{name}</h3>
                <p>{birth_year}</p>
                <p>{height}</p>
                <p>{mass}</p>
            </div>
        </div>
    );
}

export default Peopleinfo;
